// import PropTypes from 'prop-types';
import css from './Header.module.css';

export const Header = () => {
  return (
    <div className={css.box}>
      <img src={photo} alt="annamichalowska" className={css.photo} />
      <h1 className={title}>Anna Michałowska</h1>
      <h3 className={profession}>JUNIOR FRONT-END DEVELOPER</h3>
      <p>
        I’m a Junior Front-End developer. I focus on HTML5, CSS3, JS, React.
        English - Intermediate. Looking for a remote job. Development, practice
        and work for the result are important for me. I intend to develop
        innovative technologies and deliver value to people.
      </p>
    </div>
  );
};
